import React, { Component } from "react";

export default class Navbar extends Component {
  render() {
    return (
      <div>
        <nav className="navbar">
          <div className="navbar-brand"></div>
          <div className="navbar-menu"></div>
        </nav>
      </div>
    );
  }
}
